import React from 'react';
import search from './png/search.png';
import './friendsComponent.scss';
import { object } from 'prop-types';
import ItemAdd from '../itemAdd'

const propTypes = {
	randomDataObject: object,
}

const addData = [
	{ name: 'Vlad Andreyevich', owe: 30 }
];

// eslint-disable-next-line react/prop-types
const FriendComponent = ({onClickHandler, addItem}) => {
	return (
		<div className='friends-wrapper'>
			<header>
				<div className='header-container'>
					<img src={search} alt='kartinka'/>
					<button className='button' onClick={onClickHandler}>
						Add friends
					</button>
				</div>
				<section>
					<div className='total-balance'>
						<div className='photo-block'>
							<div className='img'></div>
						</div>
						<div className='balance-block'>
							<p>Total balance</p>
							{/* <p className='you-owe'>$56</p> */}
							<p className='you-are-owed'>$54.54</p>
						</div>
					</div>
				</section>
				<section>

				</section>
					<ItemAdd addItem={addItem}/>
			</header>
		</div>
	);
};

FriendComponent.propTypes = propTypes;
export default FriendComponent;
